Terreno inserido em Espaço Florestal de Produção.
No Espaço Florestal de Produção, para além das atividades associadas à exploração dos recursos florestais e à exploração dos recursos naturais existentes, são ainda admissíveis os seguintes usos considerados compatíveis:
a) Habitação unifamiliar, para residência de quem exerça atividade silvícola ou atividades conexas ou complementares à atividade silvícola e desde que comprove da inexistência de qualquer outra habitação e alternativa de localização;
b) Centros de Interpretação da Paisagem/natureza ou outros de caráter Lúdico-educacional similares;
c) Parques de Recreio e de Lazer e vias cicláveis;
d) Instalações de vigilância e combate aos incêndios florestais;
e) Construções de apoio aos percursos pedestres;
f) Instalação de infraestruturas destinadas à produção de energias renováveis, valorização de resíduos e similares;
g) Infraestruturas que, pela sua natureza não se possam localizar em solo urbano;
h) Equipamentos de Utilização Coletiva;
i) Empreendimentos Turísticos, nas seguintes tipologias:
i) Estabelecimentos hoteleiros (Hotéis e Pousadas), desde que associados a temáticas especificas;
ii) Empreendimentos de turismo de habitação;
iii) Empreendimentos de turismo no espaço rural;
iv) Parque de campismo e caravanismo;
j) Atividades industriais do tipo 2 e 3, de armazenagem e comércio por grosso, apenas nos casos em que se relacione com atividades silvícolas, de transformação de materiais geológicos ou agropecuários extraídos ou produzidos localmente; bem como as industrias agroalimentares classificadas como do tipo 1, que não estejam abrangidas pelo RJAIA, pelo RJPCIP e pelo RPAG;
k) Exploração de recursos geológicos;
l) As atividades agrícolas, pecuárias e de exploração de recursos geológicos podem ser complementadas com edificações e atividades de apoio associadas à exploração principal;
m) Atividades económicas de base local vocacionadas para o desenvolvimento de atividades de artesanato e de exploração de oportunidades e recursos energéticos e ambientais sustentáveis;
n) Postos de abastecimento de combustíveis, parque de garrafas de gás e reservatórios e instalações de atividades florestais.

